q = libnum.generate_prime(1024)
e1=libnum.generate_prime(17)
e2=libnum.generate_prime(17)
e = 65537
n = p*q
c1 = pow(2*p + 3*q,e1,n)
c2 = pow(5*p + 7*q,e2,n)
c=pow(m,e,n)
print("n=", n)
print("e1=", e1)
print("e2=", e2)
print("c1=", c1)
print("c2=", c2)
print("c=",c)
